import DarrowIcon from "../icons/darrow";

function dropdown2(props) {
  const position = {
    container: "relative",
    wrapper: "absolute right-full w-max",
    item: "py-2 px-4",
  };
  const design = {
    container: "cursor-pointer",
    wrapper: "bg-white rounded-lg shadow-md",
    item: "rounded-lg hover:bg-gray-50",
  };
  return (
    <details className={`${position.container} ${design.container}`}>
      <summary>
        <p>{props.heading} </p>
        <DarrowIcon />
      </summary>
      <div className={`${position.wrapper} ${design.wrapper}`}>
        {props.text.map((item, index) => (
          <p className={`${position.item} ${design.item}`} key={index}>
            {item}
          </p>
        ))}
      </div>
    </details>
  );
}

export default dropdown2;
